import{_ as e,o as a,c as t,a as r}from"./app-8ca7f52c.js";const c={},h=r('<h1 id="docker-启动容器报错" tabindex="-1"><a class="header-anchor" href="#docker-启动容器报错" aria-hidden="true">#</a> docker 启动容器报错</h1><h2 id="iptables-no-chain-target-match-by-that-name" tabindex="-1"><a class="header-anchor" href="#iptables-no-chain-target-match-by-that-name" aria-hidden="true">#</a> iptables: No chain/target/match by that name</h2><h3 id="根本原因" tabindex="-1"><a class="header-anchor" href="#根本原因" aria-hidden="true">#</a> 根本原因</h3><p>docker 服务启动的时候，docker 服务会向 iptables 注册一个链，以便让 docker 服务管理的容器所暴露的端口之间进行通信。</p><p>通过命令 <code>iptables -L</code> 可以查看 iptables 链。查看链路，发现并没有相关端口的 iptables 链。</p><p>如果你删除了 iptables 中的 docker 链，或者 iptables 的规则被丢失了（例如重启防火墙，笔者就是重启防火墙导致），docker 就会报 iptables error 例如：iptables: No chain/target/match by that name。</p><h3 id="解决方案" tabindex="-1"><a class="header-anchor" href="#解决方案" aria-hidden="true">#</a> 解决方案</h3><p>重启 docker 服务，之后，正确的 iptables 规则就会被创建出来。再次查看 iptables 链，相关链路已经出现，服务也正常启动。</p>',8),i=[h];function d(o,n){return a(),t("div",null,i)}const l=e(c,[["render",d],["__file","docker启动容器报错.html.vue"]]);export{l as default};
